const pauseIcon = ({ size }) => (
    <svg width="36" height="36" viewBox="0 0 36 36" xmlns="http://www.w3.org/2000/svg">
        <circle cx="18" cy="18" r="16.2" fill="none" stroke="black" stroke-width="1.8" />
        <rect x="11" y="10.8" width="4.5" height="14.4" fill="black" />
        <rect x="20.5" y="10.8" width="4.5" height="14.4" fill="black" />
    </svg>
);

export default pauseIcon;
